// import React from "react";
import bgCardFront from "../images/bg-card-front.png";
import bgCardBack from "../images/bg-card-back.png";
import bgMainMobile from "../images/bg-main-mobile.png";

const Header = () => {
  return (
    <div>
      <img src={bgMainMobile} alt="header background of a purple gradient" />
      <img src={bgCardBack} alt="back of a sample credit card" />
      <img src={bgCardFront} alt="front of a sample credit card" />
    </div>
  );
};

export default Header;

